import React, { Component } from 'react';
import '../css/App.css';
import Establishment         from './establishments/establishments';


// Un Component implémente la méthode render() et reçoit en paramètre ses props


class App extends Component {
    render() {


        return (
            <div className="App">
                <div className="App-header">
                    <h2>Welcome to { this.props.title }</h2>
                </div>
                <div className="App-intro">
                    { listEstablishment }
                </div>

            </div>
        );
    }
    render() {

        const listEstablishment = establishments.map( (establishment) => {
            return (
                <Establishment
                    key={ establishment.id }
                    establishment={ establishment } // on n'a pas oublié la props "establishment" :)
                />
            )
        })
    }
}


export default App;
